  return (
    <div className="order_page">
      <Header />

      {switchPage === 1 && <OrderTrackingInput banner_url={banner_url_1} />}
      {switchPage === 2 && <OrderTrackingOutput banner_url={banner_url_2} />}
    </div>
  );
}
